nexusDescription="[size=5]Requires\xa0[url=https://www.nexusmods.com/skyrimspecialedition/mods/68669]Lepidoptera - More Butterflies and Moths\xa0[/url]and [url=https://www.nexusmods.com/skyrimspecialedition/mods/29538]Butterflies Unchained[/url]![/size]\n<br />\n<br />[size=5]\n<br />[/size]The amazing Lepidoptera - More Butterflies and Moths by default is completely compatible with Butterflies Unchained. However, there are a few improved behaviors from Butterflies Unchained that the new critters from Lepidoptera will only exhibit if they are manually assigned to them\xa0(behaviors specifically targeting butterflies and their interactions with plants, to minimize the chances you'll see them sitting on air). This patch does just that.\n<br />\n<br />Flagged as ESL."
